import { version, Tree, Input, TreeSelect } from "antd"
import React from "react";
const { TreeNode } = Tree

const Dragable = () => {
    return <> 
          <TreeSelect
          style={{ width: '400px' }}
      >
    <Tree
    draggable={true}
    onDragStart={({ event }) => {
      if (event.target.tagName === "INPUT") {
        event.stopPropagation();
        event.preventDefault();
      }
    }}
  >

    <TreeNode
    key='1'
    value='1'
      title={
        <div>
          <Input draggable defaultValue="Can't select this" />
          But you can grab me from here !1
        </div>
      }
    />
        <TreeNode
        key='2'
        value='2'
      title={
        <div>
          <Input draggable defaultValue="Can't select this" />
          But you can grab me from here !2
        </div>
      }
    />
  </Tree>
    </TreeSelect>
  </>
}

export default Dragable
